import React, { PureComponent ,useState } from 'react';
import { Div0 } from './style.js';
import {uData1} from './a.js'
import { Bar } from 'react-chartjs-2';
import {Chart as ChartJS} from 'chart.js/auto'
const Data1 = [
    {
        name: '-3s',
        time: 12,
        num: 0,
        amt: 2400,
    },
    {
        name: '-2s',
        time: 16,
        num: 107.5,
        amt: 2210,
    },
    {
        name: '-1s',
        time: 19,
        num: 787,
        amt: 2290,
    },
    {
        name: '0s',
        time: 20,
        num: 2500,
        amt: 2000,
    },
    {
        name: '1s',
        time: 23,
        num: 787,
        amt: 2181,
    },
    {
        name: '2s',
        time: 26,
        num: 107.5,
        amt: 2500,
    },
    {
        name: '3s',
        time: 32,
        num: 0,
        amt: 2100,
    },
    ];

const DataDraw = () => {
    const [Data1,setuData1]=useState({
        labels:Data1.map((data)=>data.name),
        datasets:[{
            label:"User fA",
            data:uData1.map((data)=>data.time)
        }]
    })
    return (
        <Div0>
            <Bar data={uData1}/>
        </Div0>
    );
}
export default DataDraw;
